CREATE OR REPLACE AGGREGATE theta_sketch_agg(LONGBLOB NOT NULL)
RETURNS LONGBLOB NOT NULL
WITH STATE HANDLE
AS WASM FROM BASE64 ''
WITH WIT FROM BASE64 ''
INITIALIZE WITH sketch_handle_init
ITERATE WITH sketch_handle_union_accum_emptyisnull
MERGE WITH sketch_handle_union_merge
TERMINATE WITH sketch_handle_serialize
SERIALIZE WITH sketch_handle_serialize
DESERIALIZE WITH sketch_handle_deserialize;
CREATE OR REPLACE FUNCTION sketch_estimate
AS WASM FROM BASE64 ''
WITH WIT FROM BASE64 ''
USING EXPORT 'sketch-get-estimate-emptyisnull';
CREATE OR REPLACE FUNCTION sketch_union
AS WASM FROM BASE64 ''
WITH WIT FROM BASE64 ''
USING EXPORT 'sketch-union-emptyisnull';
CREATE OR REPLACE FUNCTION sketch_intersect
AS WASM FROM BASE64 ''
WITH WIT FROM BASE64 ''
USING EXPORT 'sketch-intersection-emptyisnull';
CREATE OR REPLACE FUNCTION sketch_anotb
AS WASM FROM BASE64 ''
WITH WIT FROM BASE64 ''
USING EXPORT 'sketch-a-not-b-emptyisnull';
CREATE OR REPLACE FUNCTION sketch_to_string
AS WASM FROM BASE64 ''
WITH WIT FROM BASE64 ''
USING EXPORT 'sketch-to-string-emptyisnull';
